class Solution {
public:
    long long maxPoints(vector<vector<int>>& points) {
        int m=points.size();//no of rows
        int n=points[0].size();//no of columns
        long long res=-1;
        vector<long long> dp(n,0);
        vector<int> LeftPartMaxLoc;
        vector<int> RightPartMaxLoc;
        vector<long long> LeftPartMax(n,-1);
        vector<long long> RightPartMax(n,-1);
        for(int j=0;j<n;j++){
            dp[j]=(long long)points[0][j];//copy the first row to dp[j]

        }
        
        
        for(int i=1;i<m;i++){//at row i, starting from 1
            
            //in the beginning, the left part is just 0, with maximized entry dp[0].
            LeftPartMaxLoc.clear();
            LeftPartMax.assign(n,-1);
            LeftPartMaxLoc.push_back(0);
            LeftPartMax[0]=dp[0];
            //the right part is from 0 to n-1, with maximized entries found through below steps

            for(int j=0;j<n;j++){  
                //the column size impose a offset like -j+1,...-1,0,-1,-2,...,-(n-1-j)
                //for the next j+1
                if(j+1<n){
                    //for newdp[j+1], the left part will have a new item dp[j+1]
                    //previously, it is (0 maps to j)
                    //....-2,-1,0,-1,-2,...
                    //next, it is (-1 maps to j)
                    //...-3,-2,-1,0,-1,...
                    //modify left part maximizer and locations vector
                    if(dp[j+1]>LeftPartMax[j]-1){
                        LeftPartMax[j+1]=dp[j+1];
                        LeftPartMaxLoc.clear();
                        LeftPartMaxLoc.push_back(j+1);// this is the case when the new one is larger than preivous left part maximizer
                    }
                    else if(dp[j+1]==LeftPartMax[j]-1){
                        LeftPartMax[j+1]=LeftPartMax[j]-1;
                        LeftPartMaxLoc.push_back(j+1);// this is the case when the new one equals preivous left part maximizer
                    }
                    else{
                        LeftPartMax[j+1]=LeftPartMax[j]-1;;// this is the case when the new one is less than previous left part maximizer.
                    }
                }
            }

            RightPartMaxLoc.clear();
            RightPartMax.assign(n,-1);
            RightPartMaxLoc.push_back(n-1);
            RightPartMax[n-1]=dp[n-1];


            for(int j=n-1;j>-1;j--){  
                //the column size impose a offset like -j+1,...-1,0,-1,-2,...,-(n-1-j)
                //for the next j-1
                if(j-1>-1){
                    //for newdp[j-1], the right part will have a new item dp[j-1]
                    //previously, it is (0 maps to j)
                    //....-2,-1,0,-1,-2,...
                    //next, it is (-1 maps to j)
                    //...-1,0,-1,-2,-3,...
                    //modify right part maximizer and locations vector
                    if(dp[j-1]>RightPartMax[j]-1){
                        RightPartMax[j-1]=dp[j-1];
                        RightPartMaxLoc.clear();
                        RightPartMaxLoc.push_back(j-1);// this is the case when the new one is larger than preivous right part maximizer
                    }
                    else if(dp[j-1]==RightPartMax[j]-1){
                        RightPartMax[j-1]=RightPartMax[j]-1;
                        RightPartMaxLoc.push_back(j-1);// this is the case when the new one equals preivous right part maximizer
                    }
                    else{
                        RightPartMax[j-1]=RightPartMax[j]-1;// this is the case when the new one is less than previous right part maximizer.
                    }
                }
            }
            vector<long long> newdp(n,0);

            for(int j=0;j<n;j++){
                //update the new dp by the LeftPartMax and RightPartMax
                newdp[j]=points[i][j]+max(LeftPartMax[j],RightPartMax[j]);
            }
            dp=newdp;
        }
        for(int k=0;k<n;k++){
            res=max(res, dp[k]);
        }
        return res;
    }
};



template <size_t rows, size_t cols>
vector<vector<int>> ArrayTo2dVector(int (&array)[rows][cols])
{
    vector<vector<int>> res;
    for (size_t i = 0; i < rows; ++i)
    {
        vector<int> row;
        for (size_t j = 0; j < cols; ++j)
            row.push_back(array[i][j]);
        res.push_back(row);
    }
    return res;
};
